// @exclude	    http://10.10.181.58/NetViewer/InquiryCommand/*
// @exclude	    https://e9cadrpts.ad.ongov.net/NetViewer/InquiryCommand/*
// @exclude	    http://e9cadrpts.ad.ongov.net/NetViewer/InquiryCommand/*
// @grant       none
// ==/UserScript==


