// set to true to log everything and use short cookies
const DEBUG = false

if (DEBUG){console.log("Debug Mode");}

// vpn restricts access outside the browser so we store the audio here
const ALERT_SHORT_DATA = "data:audio/mp3;base64,";
const ALERT_LONG_DATA = "data:audio/mp3;base64,";


// table columns:
// col 0 -- A ----------- active
// col 1 -- Status ------ status
// col 2 -- P ----------- priority
// col 3 -- Time -------- event time
// col 4 -- 0 - Events -- event id
// col 5 -- Type -------- event type code
// col 6 -- Location ---- the address
const ID = 4;
const LOCATION = 6;

// events at these SPADS are handled by AMR
const IGNORED_LOCATIONS = [
    "410 S CROUSE AVE 13210 SYR: @410 BLDG",
    "430 IRVING AVE 13210 SYR",
    "501 S CROUSE AVE 13210 SYR: @MCCARTHY MANOR",
    "614 S CROUSE AVE 13210 SYR: @ROSEWOOD HEIGHTS",
    "475 IRVING AVE 13210 SYR: @MADISON IRVING MED CENTER",
    "725 IRVING AVE 13210 SYR: @CROUSE PHYSICIANS",
    "739 IRVING AVE 13210 SYR: @CNY MEDICAL CENTER",
    "739 IRVING AVE 13210 SYR: @CNY MEDICAL CENTER: @CROUSE HOSPITAL",
    "1000 E GENESEE ST 13210 SYR: @HILL MEDICAL CENTER",
    "1000 E GENESEE ST 13210 SYR: @THE HILL MEDICAL"
];

function set_cookie(c_name, c_value = true, c_secs = 10800) {
    if (DEBUG){
        console.log(">>> Setting cookie to 10 seconds");
        c_secs = 10;
        console.log(">>> Setting Cookie");
        console.log(">>>    c_name = " + c_name);
        console.log(">>>    c_value = " + c_value);
        console.log(">>>    ex_secs = " + ex_secs);
    }

    let d = new Date()
    d.setTime(d.getTime() + c_secs * 1000);

    document.cookie = `${c_name}=${c_value}; expires=${d.toUTCString} path=/`;
}

function is_alerted(c_name) {
    var name = c_name + '=true';
    var cookies = document.cookie.split(';'); // split the cookies into an array

    for (var i=0; i < cookies.length; i++) {
        var cookie = cookies[i];
        if (cookie.trim() == name.trim()) {return true;}
    }
    return false;
}

function main(rows) {
    let call = false; // A call is anything that shows up on i/Net
    let notify = false; // notify is true if the call potentially requires an SUA response

    for (let row of rows) {
        let id = row.cells[ID].innerHTML.replace(/(<([^>]+)>)/ig, '').trim();
        let location = row.cells[LOCATION].innerHTML.replace(/(<([^>]+)>)/ig, '').trim()
        if (DEBUG){console.log(">>> id = " + id + " location = " + location);}

        if (id == "1 - Events") {
            if (DEBUG){console.log(">>> skipping the header row");}
            continue;
        }

        if (!is_alerted(id)) {
            if (IGNORED_LOCATIONS.includes(location)) {
                    call = true;
                    if (DEBUG){console.log(">>> excluded location");}
               } else {
                    notify = true;
                    if (DEBUG){console.log(">>> full alert");}
               }

            set_cookie(id);
        }
    }

    if (notify) {
        if (DEBUG){console.log(">>> playing long");}
        new Audio(ALERT_LONG_DATA).play();
    } else if(call) {
        if (DEBUG){console.log(">>> playing short");}
        new Audio(ALERT_SHORT_DATA).play();
    }
}

(function() {
    'use strict';

    window.setInterval(function () {
        let table = document.getElementById('eventmonitor');
        let rows = Array.from(table.rows);

        if (table) main(rows);
    }, 1000);
})();
